import  React, {useState } from 'react'
import TracenetForm from '../../TraceneForm/tracenetForm';
import { useNavigate } from "react-router-dom";

function Create_user() {
    const [user, setuser] = useState({
        'username' : '',
        'password' : ''
    });
    const navigate = useNavigate();

    const handleChange = (e) => {
        var { name, value } = e.target;
        console.log(name, value)
        setuser((prevState) => ({ ...prevState, [name]: value }));
    }
    const handleSubmit = (event) => {
        const form = event.currentTarget;
        event.preventDefault();
        console.log("-----inouts----", user)
        navigate('/tracenet', {state:user})
    }

    return (
        <div className='content-wrapper'>
            {/* <TracenetForm data={user} /> */}
            <div className='user-card col-md-6 offset-md-3'>
                <div className="card card-dark">
                    <div className="card-header">
                        <h3 className="card-title">Create Tracenet User</h3>
                    </div>
                    <form onSubmit={handleSubmit} >
                        <div className="card-body">
                            <div className="form-group">
                                <label htmlFor="exampleInputEmail1">Tracenet User name</label>
                                <input type="text" className="form-control" id="exampleInputEmail1" name='username' placeholder="Enter email" onChange={handleChange} />
                            </div>
                            <div className="form-group">
                                <label htmlFor="exampleInputPassword1">Tracenet Password</label>
                                <input type="password" className="form-control" id="exampleInputPassword1" name='password' placeholder="Password" />
                            </div>

                            <div className="form-check">
                                <input type="checkbox" className="form-check-input" id="exampleCheck1" />
                                <label className="form-check-label" htmlFor="exampleCheck1">Check me out</label>
                            </div>
                        </div>
                        <div className="card-footer">
                            <button type="submit" className="btn btn-primary">Submit</button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    )
}

export default Create_user
